import React, { useState, useEffect, useRef } from 'react';
import { useLocation } from 'react-router-dom';
import Editor from "@monaco-editor/react";

function Test() {
  const [overlap, SetOverlap] = useState(null);
  const location = useLocation();
  let [file, setFileContent] = useState(null);
  let [file2, setFile2Content] = useState(null);
  let [name, setName] = useState(null);
  let [name2, setName2] = useState(null);
  const monacoEditorRef = useRef(null);
  const monacoEditor2Ref = useRef(null);
  const decorationsRef = useRef([]);

  useEffect(() => {
    const { from } = location.state;

    const val = { 'data': from };

    if (!from) {
      return;
    }

    fetch("http://localhost:3500/file", {
      method: "POST",
      headers: {
        'Accept': 'application/json',
        'Content-Type': 'application/json'
      },
      body: JSON.stringify(val),
    })
      .then(res => {
        if (!res.ok) {
          throw res.statusText;
        }
        return res.json();
      })
      .then(data => {
        setFileContent(data['data']['0']);
        setName(data['data']['name1']);
        setName2(data['data']['name2']);
        setFile2Content(data['data']['1']);

        if (data['data']['overlap'] !== undefined) {
          SetOverlap(data["data"]["overlap"]);
        }
      })
      .catch(err => {
        console.error(err);
      });
  }, [location.state]);

  const handleSaveFile = () => {
    const blob = new Blob([file], { type: 'text/plain' });
    const url = URL.createObjectURL(blob);
    const a = document.createElement('a');
    a.href = url;
    a.download = name + '.yaml';
    a.click();
    URL.revokeObjectURL(url);
  };

  const handleSaveFile2 = () => {
    const blob = new Blob([file2], { type: 'text/plain' });
    const url = URL.createObjectURL(blob);
    const a = document.createElement('a');
    a.href = url;
    a.download = name2 + '.yaml';
    a.click();
    URL.revokeObjectURL(url);
  };

  function escapeRegExp(string) {
    return string.replace(/[.*+?^{}())|[\]\\]/g, '\\$&');
  }

  function findSub(string1, string2) {
    let list = [];
    let tmp = "";
    let unescape = "";

    for (let i = 0; i < string1.length; i++) {
      tmp += escapeRegExp(string1[i]);
      unescape += string1[i];

      if (!string2.match(tmp)) {
        tmp = tmp.slice(0, -1);
        unescape = unescape.slice(0, -1);

        if (unescape.length > 1) {
          list.push(unescape);
        }

        tmp = escapeRegExp(string1[i]);
        unescape = string1[i];
      }
    }

    if (unescape.length > 1) {
      list.push(unescape);
    }

    return list;
  }

  function highlight() {
    if (overlap && monacoEditorRef.current) {
      const editor = monacoEditorRef.current;
      const oldDecorations = decorationsRef.current;
      editor.deltaDecorations(oldDecorations, []);
      const model = editor.getModel();

      if (model) {
        const matchList = findSub(overlap, model.getValue());
        const newDecorations = [];

        for (let i in matchList) {
          const matches = model.findMatches(matchList[i]);
          const decorationOptions = {
            isWholeLine: false,
            className: 'highlighted-text',
          };
          const decorations = matches.map(match => ({
            range: match.range,
            options: decorationOptions,
          }));

          newDecorations.push(...decorations);
        }

        if (newDecorations.length === 0) {
          // No matches, clear decorations
          editor.deltaDecorations(decorationsRef.current, []);
        } else {
          // Apply new decorations and update the reference
          editor.deltaDecorations(decorationsRef.current, newDecorations);
        }

        decorationsRef.current = newDecorations;

        // Refresh the editor layout
        editor.layout();
      }
    }
  }

  useEffect(() => {
    if (overlap && monacoEditorRef.current) {
      highlight();
    }
  }, [overlap]);

  const handleEditorChange = (value, event) => {
    setFileContent(value);
    highlight();
  };

  const handleEditor2Change = (value, event) => {
    setFile2Content(value);
  };

  return (
    <div id='editor'>
      <h1>{overlap}</h1>
      <div className='App2'>
        <div>
          <Editor
            height="60vh"
            width="50vw"
            language="yaml"
            theme="vs-dark"
            value={file}
            onChange={handleEditorChange}
            onMount={editor => {
              monacoEditorRef.current = editor;
            }}
          />
          <button onClick={handleSaveFile}>Save 1</button>
        </div>
        <div>
          <Editor
            id="editor2"
            height="60vh"
            width="50vw"
            language="yaml"
            theme="vs-dark"
            value={file2}
            onChange={handleEditor2Change}
            onMount={editor => {
              monacoEditor2Ref.current = editor;
            }}
          />
          <button onClick={handleSaveFile2}>Save 2</button>
        </div>
      </div>
    </div>
  );
}

export default Test;
